	Vex.Flow.durationToTicks = function(duration) {
	  duration = Vex.Flow.sanitizeDuration(duration);

	  var ticks = Vex.Flow.durationToTicks.durations[duration];
	  if (ticks === undefined) {
	    return null;
	  }

	  return ticks;
	};

