	      '2/2' :  ['1/2'],
	      '3/2' :  ['1/2'],
	      '4/2' :  ['1/2'],

	      '1/4' :  ['1/4'],
	      '2/4' :  ['1/4'],
	      '3/4' :  ['1/4'],
	      '4/4' :  ['1/4'],

	      '1/8' :  ['1/8'],
	      '2/8' :  ['2/8'],
	      '3/8' :  ['3/8'],
	      '4/8' :  ['2/8'],

	      '1/16' : ['1/16'],
	      '2/16' : ['2/16'],
	      '3/16' : ['3/16'],
